import React from "react";

import GonBack from "../../component/goback/gonback";
import Table from "../../component/table/table";

export default class Index extends React.Component{
    constructor(props) {
        super(props);
        this.state={}
    }
    render(){
        const Content = {
            width:'100%',
            height:'auto',
            border:'1px solid #666666',
            background:'skyblue'
        }
        const Header = {
            width: "90%",
            height: "500px",
            border: "1px solid #666666",
            margin:"0 auto",
            // overflow:'scroll'
        }
        const Bottom = {
            width: "90%",
            height: "500px",
            border: "1px solid #666666",
            margin:"0 auto"
        }
        return (
            <div style={Content}>
                <GonBack />
                <div style={Header} className='Header'>
                    <Table />
                </div>
                <div style={Bottom} className='Bottom'>2</div>
            </div>
        )
    }
}
